import React from "react";

function Road(props) {
        return (
            <div
            className = {props.StylingInfo}
            style = {{
            height: props.height, 
            width: props.width,
            marginRight: props.paddingRight,
            marginLeft: props.paddingLeft,
            top:props.top
            } 
            }>
            </div>
        )
}

export default Road;
